function getParsedPlanSubscriptions($strFilterActiveStatus = false, $objEMSEntitlementsReponse) {
	$objXMLEntitlementsReponse = simplexml_load_string($objEMSEntitlementsReponse); 

	\define('PRODUCT_NAME', ['TF-USER-STARTER' => 'Starter', 'TF-PLUS-TRIAL-PLAN_2' => 'Plus', 'TF-PLUS-PLAN 2' => 'Plus', 'TF_product' => 'Ultimate']);
	
	\define('PLAN_LEVEL_INDEX', ['Starter'=> 10, 'Plus'=> 20, 'Ultimate'=> 30, 'Enterprise' => 30]);
	
	$strTodaysdate = date('Y-m-d');
	$arrstrExpirePlan = [];
	$arrstrActivePlan = [];
	$arrstrSchedulePlan = [];
	
	foreach ($objXMLEntitlementsReponse->entitlement as $objEntitlement) {
		$objLineItems = $objEntitlement->simpleEntitlement->lineItems;
		$arrstrPlanDetails = [];
		foreach ($objLineItems as $key => $objProduct) {
			$strProductName = (string)$objProduct->product->primaryKeys->name;
			$strPlanName = PRODUCT_NAME[$strProductName];
			
			if ("" !== $strPlanName) {
				$arrstrPlanDetails ['planName'] =  $strPlanName;
				$arrstrPlanDetails ['planDisplayName'] = strtoupper($strPlanName);
				$arrstrPlanDetails ['isTrial'] = false;
				
				if ("TF-PLUS-TRIAL-PLAN_2" === $strProductName) {
					$arrstrPlanDetails ['planDisplayName'] = 'PLUS (trial)';
					$arrstrPlanDetails ['isTrial'] = true;
				}
				
				$strStartDate = (string) $objProduct->startDate;
				$strExpiryDate = (string) $objProduct->expirationDate;

				$arrstrPlanDetails ['planStartDate'] = $strStartDate;
				$arrstrPlanDetails ['planEndDate'] = $strExpiryDate;
				$arrstrPlanDetails ['userLicenseCount'] = (string)$objProduct->numberOfCopies;			
				$arrstrPlanDetails ['planLevelIndex'] = PLAN_LEVEL_INDEX[$strPlanName];
			
				$strPlanStatus = ($strExpiryDate < $strTodaysdate) ? "Expired" : ($strStartDate > $strTodaysdate ? "Schedule" : "Active");
				$arrstrPlanDetails['status'] = $strPlanStatus;
				
				// Following conditions can be handled  in another private function to reduce complexity.
				// Expired plan
				if ("Expired" === $strPlanStatus) {
					array_push($arrstrExpirePlan,$arrstrPlanDetails);
				}
				// Schedule plan
				if ("Schedule" === $strPlanStatus) {
					array_push($arrstrSchedulePlan,$arrstrPlanDetails);
				}
				// Active Plan
				if ("Active" === $strPlanStatus) {
					array_push($arrstrActivePlan,$arrstrPlanDetails);
				}
			}
		}
	}
	$arrstrPlanSubscriptions ["Active"] = $arrstrActivePlan;
	$arrstrPlanSubscriptions ["Schedule"] = $arrstrSchedulePlan;
	$arrstrPlanSubscriptions ["Expired"] = $arrstrExpirePlan;
	
	print_r(json_encode($arrstrPlanSubscriptions));

}

